import React from "react";
import "./getsorted.scss";

const getsorted = () => {
  return (
    <>
      <div className="dropdown">
        <div className="dropdown-btn">Sort by:</div>
        <div className="dropdown-content">
          <div className="dropdown-item">Most Upvotes</div>
          <div className="dropdown-item">Least Upvotes</div>
          <div className="dropdown-item">Most Comments</div>
          <div className="dropdown-item">Least Comments</div>
        </div>
      </div>
    </>
  );
};

export default getsorted;
